import styled from "styled-components";

function streamerSidebar(props) {
  return <StreamerSidebar></StreamerSidebar>;
}

const StreamerSidebar = styled.div`
  height: 100vh;
  width: 72px;
  z-index: 5;
  background-color: #1f2a39;
  position: fixed;
  display: flex;
`;

export default streamerSidebar;
